INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (1, 1495, 1146, '2017-06-02 00:00:00', '10:57', 'Só pra deixar no jeito, posso de segunda a sexta das 23 a 00\r\nEstou quase entrando de férias da faculdade então podemos marcar em outros horarios, se marcado com antecedência... os outros horarios seriam das 18 as 22', 'Rthomazelli');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (2, 1304, 1177, '2017-06-02 00:00:00', '12:09', 'Amigos, meus horários disponíveis são finais de semana a qualquer hora, e, durante a semana, estou em casa de 12:00 às 14:30, depois disso só a partir de 22:00.', 'HugoSiqueira94');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (3, 1501, 984, '2017-06-03 00:00:00', '08:56', 'Bom dia! Terei a segunda para jogar, preferencialmente entre 11h e 12h ou entre 21h e 21h30. Aguardando sua posição com suas condições. Abç é bom fds!', 'sergiothiago');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (4, 1501, 1088, '2017-06-03 00:00:00', '09:16', 'Somente a segunda? Tempo curto de horário. Talvez entre 21:00 e 21:30 eu entre que é o horário que vc pode... ', 'SpeederBRA ');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5, 1501, 984, '2017-06-03 00:00:00', '09:20', 'Tenho terça também. Coloquei esses 2 horários preferencialmente, podendo ser em outros. Não terei como jogar antes de 10h, entre meio dia e 20h na segunda.  ', 'sergiothiago');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (6, 1501, 1088, '2017-06-03 00:00:00', '09:21', 'Segunda 20h tá ótimo pra mim ', 'SpeederBRA ');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (7, 1501, 1088, '2017-06-03 00:00:00', '09:24', 'Desculpe, me atrapalhei. Segunda não posso à noite. Mas posso terça esse mesmo horário. ', 'SpeederBRA ');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8, 1501, 984, '2017-06-03 00:00:00', '09:29', 'Tranquilidade. Deixamos pra terça. Abç ', 'sergiothiago');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (9, 1305, 431, '2017-06-03 00:00:00', '14:05', 'Vamos fazer nosso jogo logo na segunda? \r\nPosso jogar a noite após as 19h. Nos demais dias tenho q confirmar disponibilidade.', 'ThiagoCVO');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (10, 1691, 385, '2017-06-03 00:00:00', '18:53', 'Qdo pode Flávio ? ', 'Fonseca_RJ');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (11, 1304, 385, '2017-06-03 00:00:00', '18:54', 'Hey hey hey Torbe é nosso Rei !!!!', 'Fonseca_RJ');
