INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (2570, 1736, 952, '2017-07-05 00:00:00', '16:51', 'Sem querer causar confusao, ate pq meu intuito aqui nunca foi e nunca vai ser esse. Porem, não entendo esse argumento. \r\n\"pdesouza apareceu dia 3\"\r\n\r\nNão tem nenhuma regra que diga que eu tenha que responder no primeiro dia, eu tenho que realizar a partida dentro do prazo, existe um prazo decretado pelos adm no qual a partida tem de ser realizada.\r\n\r\nEu respondi e coloquei meus horários dentro do prazo.\r\n\r\nE se eu comentasse no fds qual seria a diferença? Ja que meu adversário não podia jogar fds e segundo ele, nem no horário que ele próprio colocou pois estava trabalhando. Comentar antes não faria diferença nenhuma. Ele deu horários e dias e eu comentei seguindo os horários e os dias dele.\r\nQual o meu erro nisso? Ter Postado no 3o dia sendo que temos 5 dias de prazo?\r\nO prazo foi cumprido da minha parte, meu adversário que deixou horários e não cumpriu com os horários combinados por ele mesmo.\r\n\r\nMas enfim...\r\n', 'pdesouza7');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (2571, 1740, 942, '2017-07-05 00:00:00', '16:56', 'novamente não entendi o WO...\r\nO adversario  disse que segunda era dificil jogar... e que terça poderia!\r\nOntem foi terça e assim que cheguei do serviço avisei!\r\nFiz algo errado dessa vez?', 'hoffman_0307');
