INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8224, 2336, 894, '2017-09-22 00:00:00', '18:34', 'Vamos agora ou amanhã as 12', 'Dinamite_ipua');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8225, 2336, 484, '2017-09-22 00:00:00', '18:39', 'Dinamite, já sai de casa. Estou indo pro Rock in Rio e como tu marcou para esse horário, não vou entrar amanhã.\r\n\r\nAgora, falta de hombridade de sua parte. Eu saí 18:20, esperei todo o prazo, me atrasei pro evento para jogar ctg e você me fala que entrou direto no game é mentira. Se você estivesse on eu iria te chamar para jogarmos e assim eu sair.\r\n\r\nMe atrasei para te esperar e tu agora, depois que falei que sai apareceu.\r\n\r\nA moderação irá decidir. Novamente acontece isso em um jogo ctg.\r\n\r\nHorário marcado é marcado, tem que haver compromisso.', 'leandrobranco19');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8226, 2336, 385, '2017-09-24 00:00:00', '13:14', 'Os 2 lindos não irão participar da copa do mundo \r\n\r\n1 final fora do campo .... \r\n\r\n', 'Fonseca_RJ');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8227, 2336, 385, '2017-09-24 00:00:00', '13:15', '<b>Placar e artilharia atualizados.</b>', 'Fonseca_RJ');
INSERT INTO `TB_COMENTARIO_JOGO_16` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8228, 2336, 381, '2017-09-24 00:00:00', '21:07', 'Atenção Técnico Dinamite_ipua, <br><br>          <b>De acordo com a situação ocorrida no tópico desta partida a moderação está punindo-o com  Omissão Parcial .   Lembrando que ao chegar ao total de 16 pontos na Lista Negra a moderação estará excluindo-o de todas as atividades por uma temporada.</b>', 'airesdias');
